      SELECT DISTINCT 58 * ( cor1.col1 ) / + ( - 44 ) FROM tab1 (FORMAT parquet), tab0 (FORMAT parquet) AS cor0, tab0 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1

outputs:
